module.exports = async d => {const code =d.command.code;const r = code.split("$emojisFromMessage").length - 1;const after = code.split("$emojisFromMessage")[r];if(after[0]==="["){const inside = after.slice(1).split("]")[0];const[text, separator = ", "]=inside.split(";");return {code:code.replaceLast(`$emojisFromMessage[${inside}]`, (text.addBrackets().match(/(<a?:(\w{0,32}):(\d{17,18})>|\p{Emoji_Presentation})/gu)||[]).join(separator).deleteBrackets())}}else{return{code:code.replaceLast(`$emojisFromMessage`,(d.args.join(" ").match(/(<a?:(\w{0,32}):(\d{17,18})>|\p{Emoji_Presentation})/gu)||[]).join(", ").deleteBrackets())}}}